const Page11 = () =>{
    
    return (
        <div className="sheet">
            <h1>Saying goodbye</h1>
            <div className="left">
                <div id="instruction_box_number_1_page_11_script_16" className="custom_svg demo_box">
                    <textarea onChange={event => handleChange(event)} id="text_box_number_1_page_11_script_16" defaultValue={getValue("text_box_number_1_page_11_script_16")} />
                </div>
            </div>
        </div>
    )
}

export default Page11;
